import weather from "../src/images/weather.jpeg";
import covid from "../src/images/covid.jpeg";
import web from "../src/images/home.jpg";

const CardConfig = [
    {
        imgsrc:weather,
        title: "weather report"

    },

    {
        imgsrc:covid,
        title: "Covid Statstics"

    },

    {
        imgsrc:web,
        title: "weather report"

    },

    {
        imgsrc:web,
        title: "weather report"

    },

    {
        imgsrc:web,
        title: "weather report"

    },

    {
        imgsrc:web,
        title: "weather report"

    }
];

export default CardConfig;
